import React from "react";

const DropDown = () => {
  const [open, setOpen] = React.useState(false);

  const handleOpen = () => {
    setOpen(!open);
  };

  const SingUpUrl="https://localhost:7003/Wish/all";

async function getWishs()
{
  const token= await getToken();
  let response = await fetch(SingUpUrl,
  {
    method: "GET",
    headers:     
    {
      'Accept': 'application/json',
      'Authorization': "Bearer " + token,
      'Content-Type': 'application/json'
    },
  });
  const j = await response.json();
  return j;
}
  return (
    <div className="dropdown">
      <button onClick={handleOpen} className="menuButton"></button>
      {open ? (
        <ul className="menu">
          <li>
            <a href="profile">Профиль</a>
          </li>
          <li>
          <a href="">Список желаний</a>
          </li>
          <li>
          <a href="add">Добавить желание</a>
          </li>
          <li>
          <a href="vda">Выйти</a>
          </li>
        </ul>
      ) : null}
    </div>
  );
};

export default DropDown;
